import React from 'react';
import { Link } from 'react-router-dom';
import './styles/Home.css';

const Home = () => {
  return (
    <div className="home-container">
      {/* Imagen grande de la empresa */}
      <img src="/logo.png" alt="Logo de la empresa" className="logo-img" />
      
      {/* Botones debajo de la imagen */}
      <div className="button-container">
        <Link to="/menu" className="btn">Ver Men√∫</Link>
        <Link to="/carrito" className="btn">Ver Carrito</Link>
        <Link to="/pedido" className="btn">Hacer Pedido</Link>
      </div>
    </div>
  );
}

export default Home;
